INSERT INTO `wp_posts` VALUES (1,1,'2014-02-09 22:03:26','2014-02-09 22:03:26','Welcome to WordPress. This is your first post. Edit or delete it, then start blogging!','Hello world!','','publish','open','open','','hello-world','','','2014-02-09 22:03:26','2014-02-09 22:03:26','',0,'http://javamarshall.com/prospector/?p=1',0,'post','',1),(2,1,'2014-02-09 22:03:26','2014-02-09 22:03:26','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\r\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like piña coladas. (And gettin\' caught in the rain.)</blockquote>\r\n...or something like this:\r\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\r\nAs a new WordPress user, you should go to <a href=\"http://javamarshall.com/prospector/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','trash','open','open','','sample-page','','','2014-03-09 22:57:12','2014-03-09 22:57:12','',0,'http://javamarshall.com/prospector/?page_id=2',0,'page','',0),(4,1,'2014-02-09 22:12:48','2014-02-09 22:12:48','','ppalogobig','','inherit','open','open','','ppalogobig','','','2014-02-09 22:12:48','2014-02-09 22:12:48','',0,'http://javamarshall.com/prospector/wp-content/uploads/2014/02/ppalogobig.png',0,'attachment','image/png',0),(5,1,'2014-02-09 22:18:14','2014-02-09 22:18:14','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in 